local Colors = {"BLACK", "BLUE", "GREEN", "CYAN", "RED", "MAGNETA", "BROWN", "LIGHT_GRAY", "DARK_GRAY", "LIGHT_BLUE", "LIGHT_GREEN", "LIGHT_CYAN", "LIGHT_RED", "LIGHT_MAGNETA", "YELLOW", "WHITE"}
local s = 16
local m = 0
local veri = ""
game:GetService("RunService").RenderStepped:Connect(function()
	s = s + 1
	m = s % 16
	if m > 0 then 
		rconsoleprint('@@'..Colors[m]..'@@')
		rconsoleprint(''..veri..'')
	elseif m == 0 then 
		rconsoleprint('@@'..Colors[m + 1]..'@@')
		rconsoleprint(''..veri..'')
	end
end)  


